import React, { Component } from "react";

const Project = props => {
  return (
    <React.Fragment>
      <h1>Project {this.props.projects.id}</h1>
      <h3>Name: {this.props.projects.shortname}</h3>
    </React.Fragment>
  );
};

export default Project;
